import { Component, OnInit } from '@angular/core';
import { UsuarioServiceService } from 'src/app/Services/Usuario/usuario-service.service';

import { Usuario } from 'src/app/Models/Usuario';

@Component({
  selector: 'app-home-usuario',
  templateUrl: './home-usuario.component.html',
  styleUrls: ['./home-usuario.component.css']
})
export class HomeUsuarioComponent implements OnInit {
  usuarios: Usuario[] = [];
  constructor(private usuarioService: UsuarioServiceService) { }

  ngOnInit(): void {
    this.usuarioService.BuscarTodos().subscribe(usuariosResponse => {
      this.usuarios = usuariosResponse.data;
      console.log('usuariosResponse.data ', usuariosResponse.data);
    });
  }
}
